import React from "react";
import headerLogo from "../images/logo.svg";

function SignIn(){
  return(
    <>
    <header className="header">
      <img className="header__logo" alt="Логотип" src={headerLogo} />
      <button class="header__button-exit">Регистрация</button>
    </header>
        <body>
        <form className="registration">
          <h2 className="registration__title">Вход</h2>
          <input className="registration__input" placeholder="Email"></input>
          <input className="registration__input" placeholder="Password"></input>
          <button className="registration__submit">Войти</button>
          <p className="registration__link"> Уже зарегистрированны? Войти</p>
          </form>
        </body>
</>
  )
}
export default SignIn;
